import React, { useEffect } from "react";
import axios from "axios";

const Table3 = ({ apiData2 }) => {
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get(
                    process.env.REACT_APP_HOST + "/api/ping/check-cctv2"
                );
                // อย่าตั้งชื่อตัวแปรเหมือนกันในพารามิเตอร์และในฟังก์ชัน
                // setApiData(response.data);  // ไม่จำเป็นต้องใช้
            } catch (error) {
                console.error("Error fetching data:", error);
            }
        };

        fetchData();

    }, []);

    return (
        <div>
            <h1>Table3</h1>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>IP</th>
                        <th>Phase</th>
                        <th>Status</th>
                    </tr>
                </thead>
                <tbody>
                    {apiData2 && apiData2.data.map(item => (
                        <tr key={item.ip}>
                            <td>{item.name}</td>
                            <td>{item.ip}</td>
                            <td>{item.phase}</td>
                            <td>{item.status}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Table3;
